void doGet(BitSet a, FixedBitSet b) {
  int max = b.length();
  for (int i=0; i<max; i++) {
    if (a.get(i) != b.get(i)) {
      fail("mismatch: BitSet=["+i+"]="+a.get(i));
    }
  }
}

